import React from 'react'
import '../App.css';

import ProfilePic from '../Assets/ProfilePic.jpg'

export default function AboutMe() {
    return (
        <div>
            <section id = "AboutMe">
                <img 
                    alt="Profile" 
                    src = {ProfilePic} 
                    style={{width: 280, height: 400, borderRadius: "50%", }} 
                    overflow = 'hidden'
                />
          <p>About Me</p>
          <p>About Me</p>
          <p>About Me</p>
          <p>About Me</p>
        </section>
        </div>
    )
}
